hash::Hash::hash.doc:
Feeds this value into the given [`Hasher`].

# Examples

```
use std::hash::{DefaultHasher, Hash, Hasher};

let mut hasher = DefaultHasher::new();
7920.hash(&mut hasher);
println!("Hash is {:x}!", hasher.finish());
```

